drawl or D for Deposit\")\n       if tt\u003d\u003d\"W\":\n           amt\u003dint(input())\n           if amt \u003c\u003d balance:\n               balance \u003d balance - amt\n               print(\"thanks an dyou update balance is\",balance)\n           else:\n               print(\"insuffient funds\")\n       elif tt\u003d\u003d\"D\":\n           amt \u003dint(input())\n           balance \u003d balance + amt\n           print(\"thanks for the amount uuh\",balance)\n       else:\n           print(\"enter the valid character\")\n   else:\n       print(\"access denied\")\nelse:\n   print(\"invalid card\")\n\n\n\n\nFinished until nested for loop\n\n\n\n\n\n\n\n\n\n\nimport requests\nimport json\napi_key \u003d \"1659cf5477bd0a121c844691d4bd9e81\"\ncity\u003dinput()\nurl\u003d\"https://api.openweathermap.org/data/2.5/weather?q\u003d%s\u0026appid\u003d%s\u0026units\u003dmetric\"% (city, api_key)\nresponse \u003d requests.get(url)\ndata \u003d json.loads(response.text)\n#print(data)\nprint(\"the temperature in {} \".format(city)+str(data[\"main\"][\"temp\"]))\n\nDICTIONARY reference\n\n*\n\nFunctions started and ask for LLm plan of action\n\n\n\n\n\n\n\n\n\n#higher order function\ndef name(x):\n   if x.islower():\n       return True\n   else:\n       return False\n\ndef validation(x):\n   if x.isalpha() and name(x):\n       return \"all good\"\n   else:\n       return \"something wrong\"\n\nvalidation(\"nethajinirmal\")\n\n\nRecursive function\n\ndef factorial(n):\n   # Base case: if n is 0 or 1\n   if n in (0, 1):\n       return 1\n   # Recursive case: n! \u003d n * (n-1)!\n   else:\n       return n * factorial(n-1)\n\n# Example usage\nprint(factorial(5)) \n\n\nd\u003d10\n\ndef gi():\n   global d\n   d\u003dd+2\n   s\u003dd*10\n   return s\n\n\nprint(d)\nprint(gi())\nprint(d)\nNeed to do lambda,map ,filter,c and o\n\n\n\nCOMPLETION RECORD ( rough draft )\n\n\u0010\u0012\u001cTOPICS\n\u001cREMARKS\n\u0012\u001cBasic python\n\u001cdone\n\u0012\u001cAdvanced python\n\u
